def f(n): # A051885 as a string
    q, r = divmod(n, 9)
    return (str(r) if r else "") + "9"*q
def a(n):
    if n == 1: return 1
    if n&1:
        m = min(n-2, 9)
        s, t = "" if m == n-2 else f((n-2-m)//2), str(m)
    else:
        s, t = f((n-2)//2), ""
    left = "1" + "0"*((n-2-(n&1)-2*len(s))//2) + s
    return int(left + t + left[::-1])
print([a(n) for n in range(1, 22)]) # _Michael S. Branicky_, Dec 18 2025

